import React from "react";
import { listCards } from "../utils/api/index";

// Component to return number of cards in deck
export default function CardCount({ deckId }) {

    //Get the cards for that deck
    const deckCards = listCards(deckId);


    return <h5>{deckCards.length} cards</h5>
};
